# -*- coding: utf-8 -*-

import numpy as np
import json

#Extract text into a list from file.txt
#Input : File.txt
#Output : List([Line], [line],...)
def Text2List(PATH):
    file = open(PATH)
    file = file.read()
    ligne =[]
    texte = []
    file =file.split('\n')
    for i in range (0,len(file)-1,1):
        file[i] = file[i].split(',')
        ligne =  file[i][8:]
        ligne=' '.join(ligne)
        ligne = ligne.split(' ')
        texte.append(ligne)
    return texte
    file.close()

#Get labels from JSON File {Dictionnary}
#Input : JSON_FILE_PATH7
#Output : abel list : lst_company, lst_date, lst_address, lst_total
def json2List(JSON_PATH):
    json_file=open(JSON_PATH)
    json_string=json_file.read()#recuperation du contenu du fichier en string
    json_dict=json.loads(json_string)#creation d un objet json (dictionary)a partir d un string
    #creation listes de mots a partir de la valeu de la cle correspondante
    lst_company=json_dict["company"].split(',')
    lst_company=' '.join(lst_company)
    lst_company= lst_company.split(' ')
    lst_date=json_dict["date"].split(',')
    lst_date=' '.join(lst_date)
    lst_date= lst_date.split(' ')
    lst_address=json_dict["address"].split(',')
    lst_address=' '.join(lst_address)
    lst_address= lst_address.split(' ')
    lst_total=json_dict["total"].split(',')
    lst_total=' '.join(lst_total)
    lst_total= lst_total.split(' ')
    return lst_company, lst_date, lst_address, lst_total

#Matching labels to text sentences
#Input : OutputFileName.txt , TEXT_PATH_LIST, JSON_PATH_LIST
#Output : WordsTextLabeled.txt
def WritingFileWord(file_name, TEXT_PATH_LIST, JSON_PATH_LIST):
    f= open(file_name,"w+")
    for i in range (0, len(TEXT_PATH_LIST), 1):
        LIST=Text2List(TEXT_PATH_LIST[i])
        lst_company, lst_date, lst_address, lst_total=json2List(JSON_PATH_LIST[i])
        for j in range(0, len(LIST), 1):
            sentence = LIST[j]
            for s in range(0, len(sentence), 1):
                f.write(sentence[s]+' ')
            f.write(',')
            for k in range (0, len(LIST[j]), 1):
                label='0,'
                # f.write(LIST[j][k]+',')
                for word in lst_company:
                    if (LIST[j][k]==word):
                        label = 'company,'
                for word in lst_date:    
                    if(LIST[j][k]==word):
                        label = 'date,'
                for word in lst_address:   
                    if(LIST[j][k]==word):
                        label = 'address,'
                for word in lst_total:
                    if(LIST[j][k]==word):
                        label = 'total,'
                f.write(label)
            f.write('\n')   
    return f.close()

#Duplicate lines to include previous and next lines in each line
#Input : Path to File.txt
#Output : Lines duplicated and associated label
def Duplicate_Text2List(PATH): 
    file = open(PATH)
    file = file.read()
    ligne =[]
    label=[]
    texte_label =[]
    texte = []
    file =file.split('\n')
    for i in range (0,len(file)-1,1):
        file[i] = file[i].split(',')
        ligne =  file[i][0]
        label = file[i][1]
        texte_label.append(label)
        texte.append(ligne)
    return texte, texte_label
    file.close()

#Creating and filling file.txt From a WordsList and apply LabelList
#Input : OutputFileName.txt , WordsList([Line], [line],...) , LabelList([Label1], [Label2], ...)
#Output : File.txt
def WritingFileSentence_duplicateLines(file_name, LIST, LABEL_LIST):
    sentence1=[]
    sentence2=[]
    sentence3=[]
    Duplicated_sentence = (sentence1, sentence2, sentence3)
    f= open(file_name,"w+")
    padding_label = '0'
    #Head_PADDING_KEY
    key0=LIST[0]
    key1=LIST[1]
    key2=LIST[2]
    key_label= LABEL_LIST[0]
    #Bottom_PADDING_KEY
    last_key0 = LIST[-1]
    last_key1 = LIST[-2]
    last_key2 = LIST[-3]
    last_key_label= LABEL_LIST[-1]
    #Middle_CONTENT
    for j in range(0, len(LIST), 1):
        sentence1=LIST[j]
        Duplicated_sentence[0].append(sentence1)
    for k in range(1, len(LIST), 1):
        sentence2=LIST[k]
        Duplicated_sentence[1].append(sentence2)
    for l in range(2, len(LIST), 1):
        sentence3=LIST[l]
        Duplicated_sentence[2].append(sentence3)  
    #REDACTION FICHIER TXT
    #Head_PADDING
    f.write('null'+' '+'null'+' '+key0+','+padding_label+'\n')
    f.write('null'+' '+key0+' '+key1+','+key_label+'\n')
    #MIDDLE_Content
    for m in range(0,len(LIST)-2,1):
        f.write(Duplicated_sentence[0][m]+' ')
        f.write(Duplicated_sentence[1][m]+' ')
        f.write(Duplicated_sentence[2][m]+' ')
        f.write(','+LABEL_LIST[m+1])
        f.write('\n') 
    #Bottom_PADDING
    f.write(last_key1+' '+last_key0+' '+'null'+','+last_key_label+'\n')
    f.write(last_key0+' '+'null'+' '+'null'+','+padding_label+'\n')
    return f.close()

#Creating and filling file.txt From a WordsList and apply LabelList
#Input : OutputFileName.txt , WordsList([Line], [line],...) , LabelList([Label1], [Label2], ...)
#Output : File.txt
def WritingFileSentence_non_duplicateLines(file_name, LIST, LABEL_LIST):
    sentence=[]
    List_sentence = (sentence)
    f= open(file_name,"w+")
    #Middle_CONTENT
    for j in range(0, len(LIST), 1):
        sentence=LIST[j]
        List_sentence.append(sentence)
    for m in range(0,len(LIST)-2,1):
        f.write(List_sentence[m]+' ')
        f.write(','+LABEL_LIST[m])
        f.write('\n') 
    return f.close()

#Duplicate lines to include previous and next lines in each line from a File.txt
#To a new FileTextDuplicated.txt Keeping middle-sentence label
#Input :Input_File_Name.txt, Output_File_Name.txt
#Output : Duplicated_Lines_Input_File.txt 
def duplicateLines(Input_File_Name, Output_File_Name):
    LIST, LABEL_LIST = Duplicate_Text2List(Input_File_Name)
    WritingFileSentence_duplicateLines(Output_File_Name, LIST, LABEL_LIST)

def NonDuplicateLines(Input_File_Name, Output_File_Name):
    LIST, LABEL_LIST = Duplicate_Text2List(Input_File_Name)
    WritingFileSentence_non_duplicateLines(Output_File_Name, LIST, LABEL_LIST)
